(639, 3, '1928f2f3c3f2a757', '[For immediate settlement] Your Terminated Account 920368270 with Globe at Home', 'consumercollectionsremedial@globe.com.ph', 'Dear Valued Customer,\r\n\r\nOur records show that we have not received the payment of P5,314.39 as of October 14, 2024 for Globe at Home account number 920368270. Our non-receipt of payment shows you may have missed our reminders.\r\n\r\nWith this, please pay the total amount of P5,314.39 within five (5) days from receipt of this email. Otherwise, we shall be constrained, much to our regret, to institute the necessary court actions against you.\r\n\r\nIf you wish to discuss this matter further, please reply to this email. You may pay via the GCash app at https://go.gcash.com/app ( https://go.gcash.com/app ) or any accredited payment channel. Kindly use your account number as payment reference.\r\n\r\nIf full payment has been made recently, we sincerely thank you, and please disregard this notice.\r\n\r\nGlobe Remedial Collections', 'Safe', '0000-00-00 00:00:00', '2024-10-15 09:58:09');
