(641, 3, '1928d4146adb0efc', 'Welcome to Gemini', 'Google Gemini <google-gemini-noreply@google.com>', '\r\n\r\nMeet Gemini, your new AI assistant\r\n\r\nWelcome to Gemini, your upgraded AI assistant from Google that can help you  \r\nsupercharge your creativity and productivity. Gemini can not only provide  \r\nthe hands-free help that you love from Google Assistant, but can go far  \r\nbeyond in conversationality and richness of the tasks it can help with.  \r\nWith Gemini on your phone, you can now have a natural, free-flowing voice  \r\nconversation through Gemini Live1 and get help writing, creating, learning  \r\nand more. Gemini will now serve as your Android device’s primary assistant.  \r\nLearn  \r\nmore<https://notifications.google.com/g/p/ANiao5rA5Jqsqf3EY5YBNjg_GPd3Ix7tTxzWlDSFHjCdUjreziT0i4ukr4jFcs-rVdYEDggIu631jsaFNWqyfFU2OZ1nM8_gZKRFtBsaRrCbFiVShvTBDRbA-NF26hiImFVgafBrjkhrjwmFM8XT8sa7Q1XYZyXft0yxcta1j1F768Tvm-yFi6u74_Qrs5EFcM2WCIEoM9aRRwHjU9n_Kl5uvWt7L77XP2BOLm4l0m-c9HDRoFU1DrF3lEEO1emLEEFKbblvu3EuyFZir6QVyq_T34ABA582Wrzgh7aq5yZ1A4cVe4BMbH9CXmT1X5YtopPKli8TD77Mb0Zgzy-b>  \r\nabout what you can do with Gemini.\r\n\r\nIf you wish to switch your device\'s primary assistant to Google Assistant,  \r\nyou can do that in Settings. How to  \r\nswitch<https://notifications.google.com/g/p/ANiao5pO3BWgCqDAyjA5tMNzSqR1URkclxdcZqHI09p9PEXSRDlxOCsyyk1xFqWO0tSsfwpQfySHzsvkRyBXS3O2uMwSKciADx0XV9M-ClEatpSSmB5Y7G4ey6iCEMgP7Z_xu-032G95FbSpYRTNbtY0IGS5IAaieWXLHE7gueGPSSy4OJHqTVqPl7qG_PNOd8IQNbxJxgyZtdLOKQmdUt-4lwkqjcj6LPLmarjwAj1zCsfPo_MYlZ60pLLXLgxYR54nw8bxtAiz79axRw>.\r\n\r\nHow Gemini handles data and works with other services\r\n\r\nGemini uses info from your devices and services to help you\r\n\r\nGemini uses info from your devices and services to provide more customised  \r\nand context-aware assistance. Gemini accesses certain system permissions  \r\nand data (including through Google Assistant), like call and message logs,  \r\ncontacts (to help you keep in touch) and screen content (to help you act on  \r\nit).\r\n\r\nGemini works with Google Assistant\r\n\r\nGemini gets help from Google Assistant for certain actions. When that  \r\nhappens, relevant Assistant settings such as personal results apply. When  \r\nGemini handles actions through extensions, those Google Assistant settings  \r\nwon’t apply. Learn  \r\nmore<https://notifications.google.com/g/p/ANiao5qmBizrnDMJWfKd3uEhZRHewcWK9d1dyV8MunKXavd9BKxEhvgx9b-27TLLMfrTWb_fA2yOQaFL4ytBExGvnv4KqeDm4CHWqirQ2FsZ5CLprCndYjWh2RX-m2wUObtBaa3yZ61EvYKVrpMSC0dvJLIOwMgSMsgNWMetwLz6exSTAskKyyrUiZTjRUrvgEW4KleKNYShbgZ9tJKaANS8KtxSAVp_O7jstSr-vvVHToxggf3Gx5ip3ZbdCDl8ZBbjfDf554RZWCBxErdAczB2X9f5bYYmtKmiezIEzUQ6OLABv9lKF0D027dfVbk6myLtHCaP_bt5NHJ-1Ps>.\r\n\r\nGemini Extensions\r\n\r\nWith extensions, Gemini can respond with real-time info from other  \r\nservices, like Google Maps and YouTube. You can also choose to connect  \r\nservices like Google Workspace and YouTube Music. If Gemini finds an  \r\nextension that can help, it will send information from your conversation,  \r\nand other relevant information, to that extension to help it generate a  \r\nbetter response. You can manage your Gemini extension settings. Learn  \r\nmore<https://notifications.google.com/g/p/ANiao5qUl_La-leClrLc5XNtdA_F5rzyUgfBoLNuyge-zzOpTHG68QFHfJzxbAQUy6EPF8hMTWj8QILb2qSbHj9qMAVWRVuy6qApHSaSv2IOJH6BpJj7Ka1ALYogSvOWwi9v-XqWI4PYqwehZ0ULxTQ9hwn-Fx9bOVABw1H7Uvhz9phl2GIU3Y4zt7WsnQJ6GrbWwPysTn99AzWRifG97XkgcVWr-OwIsUUq-KU3WQyp7SyHTr_u2nMlRrI8lJk4cTDslTP05rchDTU9u_4ST25fvZ_iS70DcjwwRMVJ4gv-9zZp9jr8r9LViT9o0yZcFOIYdJG9RiRoDLQHa3m1gaGFlA>.\r\n\r\nThings to know when speaking to Gemini\r\n\r\nIf ‘Hey Google’ and Voice  \r\nMatch<https://notifications.google.com/g/p/ANiao5rCL5uKbv0Okl6oUAl0Dlr-SLVLKCweRRhy-fglinD1_ew4V--nONN0rjZC3aEnLYo2JNV_3CuEHBBeHfEI5d9HwhDk7bvwAdWvOP1aI9Z-8bxZ4VKWBogKokJL0fhxSLv0mOOPvmGvWe2nZ0uPAT5joeiA92dPQnfiCxODWxtMEZamUQADvkc23n5yKFf08g0rf11GmRE2FWXK5pUrUm1lfJrPpJOu6toM1QECg8SSLxS1-ruQODRluwfZrTOEIIQ8W4uvvKx-f5pDIcfi7yfcu8ZFGHeUz9ceyqadI0FFVV9OxFuAZ_sEuVEtqn4pVnH5jknr-IcxGtvzAiu3KkoqEWS9GPiIOpZCpxZQ2qL_U_UXy5NzsduohCzdI5mvqc3uXde904uPHsjK5Y9g-IRlVbxeFKlOb5Hft_blQFYIgJ21SYQNuBzVYnNfVSj75HX-Jyvy3WEP4WUzt-vUxvWkxmYrX7ipBl3CXBKvE2NyrGACnsuet7xJ>  \r\n(powered by Google Assistant) are on in Settings, you can talk to your  \r\nassistant hands-free. Gemini may activate when you didn’t intend it to, for  \r\nexample if it detects a noise like ‘Hey Google’ or if you accidentally  \r\nactivate it by touch. If Gemini responds, it will treat your input like a  \r\nnormal activation.\r\n\r\nGemini responses on lock screen\r\n\r\nGemini helps you with answers and actions even when your device is locked.  \r\nTo protect your privacy, Gemini will still require you to unlock for some  \r\nactions, for example when responses contain your personal content from apps  \r\n(such as calendar events). You can change your Gemini on lock screen  \r\nsettings. Learn  \r\nmore<https://notifications.google.com/g/p/ANiao5o6E0yQjYklFZKX_U57IOz4jlu3vtKFt1ZCKE1Jcke7j5Z33EgZG69YUDu-QUSjQpIS7uq4HZ7jogeJiCOnizPIia10AEKixWEvPUT1iszRJs2y3jSZlYDp13GcfZxp9FKSm7baWVMWK2BhRT_SVF6MxNuFZr5SIj1160_quyTuhS0IZYLSmd21OZA6AYRgSvBhBI8qX5fq4gESJeOEsgpTd2uj0BeiD8-nPmObeZsD7BaOHDoIRPBAdQ-LNwAT7sNg>.\r\n\r\nGemini activity and your choices\r\n\r\nWhen you use Gemini, Google collects your activity, like your chats and  \r\nlocation info. This data is stored in your Google Account and used to  \r\nimprove Google AI and services with help from trained reviewers. You can  \r\nmanage your Gemini Apps activity  \r\nsettings<https://notifications.google.com/g/p/ANiao5r9PCumz5-RHdPZSUw13U6rc43G-Rqb-1Fiar7gLKPETcIBypkekYXmQnN6TD5yrf58IAGdOUaingES-F11gQAUZ_k3gNhcwmlcX6cz6ZIHDu44fVUIXAfUAeQUAHY3OElX1w6-Gvk7I9pzXw_mmtKgsm82vntDbd9oxCc4qo5xhLepvChTzN-obgbyxC6pU1b5WnhwCv86lrPbXgffNlrQoGd1hQ4dtQZISWrRD4FP18BKNeWob1ef33tjaz556QNLbROcJcrgH8ji4eUuClz5jbvJ29ly8JlQxDuoAxSMm7NRZBuqmwKzvx7J>.  \r\nDon\'t enter info you wouldn’t want reviewed or used. Learn  \r\nmore<https://notifications.google.com/g/p/ANiao5q7YKuZMpWC9s1DAsxDpIUSB_S4eDdJDSxvlWJ4weTze4lMYiq7LQeoIisbm0zY67O7t0pD0E6XTgqGZlEgMQ9yLiCs6508f3vrvWhz61yRLQdjYFnEqACqxpucrC47M-SZet2u7ZpXe-1Bi7TFers53Zms11t-F4LBkfUzVyrkBt7D9lIaqh4zmLepR0lVp4TEEof4fjSRskGTSobDkeLGyq1ked_RN-JnbxHMNVJaaZjYJpq5YIH2MGu2bNGFBKNpXgc0bdsnMg5MXGLzXHgNuJ9CfnIMngZlZsG9WKxc-HlnFzda2seca6cQNAheLsX1sq3Qn8Ycta2KKbaR9d0pwaeHQpK33VJ9f6wHMfjuTSx2QlviNvoRDGTW9ODf6xV3kih_zUHUOoj1VPsBbWe7PabzKmPQV7EogIxVcU1M_iRNhg_RIggX3GEB67qgma45W3E3pCgqRXlTTmGElNAWhmzxFRjd3SyPhsfuaSOky1ZwT3Kll0VRMfvCj5Pv-szfFnT2CT1n1K3wENnt4rI04G2EhNE-1q2aQqFwFO2GyzGkL8axpuQfy2dY8N3X6g_0V3P3nasVOqV3d5juMy4n-sXWX5doeQ>.\r\n\r\nNote: Google  \r\nTerms<https://notifications.google.com/g/p/ANiao5pj8T7zPMrI4S-Ypqy7W9cDSMSb8c1O2l0UFw8udKEoRIm8_-GMhms2ONMfht5K7bbTG8UtMGzX0FtvbKM04LGDWQuDHtF7hea2fZKylPPm3Zyxb7P-rNeS1hy3CTUbbHn1XbtHve_6nodgk5ch01d3rH7GnOhUU8vQZMKx7LFthoIfHAhKsZVhMEx3Sbbg2ZXib0fiX44s2luiF-5Sn-a3bOzF1osHa902OtPzMPRLmt8>  \r\napply to Gemini  \r\nApps<https://notifications.google.com/g/p/ANiao5o-qGkbp8CL3eYWIjikcKz8XyqSMCRgJZJUgP7o3BbQOHdZWJ5HIzjDKFJUqhJ7BKUkI67MU_8d7BeFBkLjfbyrgEOT2fDOfg6vF0lpST9elMVEBOn42i-lCTDfinF1-XHAEYevZizmcmmOEWeOpb7_gWvckJ8RT-1PTMeFBouq1KLa8cdZiaT6Ivy1qJ_r2RifCFic4RTUJBIfJlYlVdi21Ni5JARv9XYELW4HLTFy0uV_AdGx6LZSR0rwhp8zi0kmdeSW7V6n_Dfkd4rGJOhMC11QTrhiaO6Sc4UGDosBx8OALImWNSBmpsFM5SD6>.  \r\nGoogle will process your data as described in the Google Privacy  \r\nPolicy<https://notifications.google.com/g/p/ANiao5p2IxUK8p3yXLQ2AFGJ8oZ3OCDofes9S1ZEMzq3qUwOMj-QZapGcmvQqmW3kPVjrmF7rmZIuKm8woemH2rCXv0BVuS-6DTVCzFdKVzvMv_2TPVx11fV7HhTX9chK-USOy-bvcYAaabQ_5C81Rmol4mDBb7GhEN3cJmK4RzxA69ArC6gsb_MFtneatSn0iU6tXoNxJ8XPQvhv6OLPg0TecQgvk9P_bbcaqfyrsypKIItueytQM76QfboW20I>  \r\nand the Gemini Apps Privacy  \r\nNotice<https://notifications.google.com/g/p/ANiao5qqtq_BgvYY8UPG-TEZx22R55WElHsW0hChsIf7KDKVuJOlNRbQyTdWcYANx4cTYiJPaJRVaCl6ct_qu5YTH5MpIdSdXG6clys20DELNGs_XXQhIf9eIxJuGngfxUooBhE-39K