(643, 3, '1928b9d2c234eed4', 'Kaoru, build your data science portfolio', 'DataCamp <team@datacamp.com>', 'DataLab is an AI-powered data notebook to go from data to insights. ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌\r\n ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌\r\n ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌\r\n\r\n****************************************************************************************************************************************************************************************************\r\nDataCamp ( https://www.datacamp.com?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n****************************************************************************************************************************************************************************************************\r\n\r\n----------------\r\nDiscover DataLab\r\n----------------\r\n\r\nDiscover DataLab ( https://www.datacamp.com/datalab?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\nGo from data to insights faster with DataCamp’s AI-assisted notebook.\r\n\r\nGet Started ( https://www.datacamp.com/datalab?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n----------------------------\r\nMake the most out of DataLab\r\n----------------------------\r\n\r\n \r\n\r\n1\r\n\r\nStart from a template or dataset\r\n--------------------------------\r\n\r\nAccess our curated library of templates ( https://www.datacamp.com/datalab/templates ) and datasets ( https://www.datacamp.com/datalab/datasets?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto ) to start your next data analysis.\r\n\r\nLearn More ( https://www.datacamp.com/datalab/datasets?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n➜ ( https://www.datacamp.com/datalab/datasets?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n2\r\n\r\nAsk the DataLab AI Assistant\r\n----------------------------\r\n\r\nDiscover data insights effortlessly by asking the AI assistant to analyze data, write code, and fix and explain mistakes.\r\n\r\nLearn More ( http://workspace-docs.datacamp.com/work/ai-assistant?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n➜ ( http://workspace-docs.datacamp.com/work/ai-assistant?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n3\r\n\r\nBuild a data portfolio\r\n----------------------\r\n\r\nTackle data projects and add your best ones to your DataCamp portfolio.\r\n\r\nGet Started ( https://www.datacamp.com/datalab?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n➜ ( https://www.datacamp.com/datalab?utm_source=customerio&utm_medium=email&utm_campaign=221212_1-nurture-t9_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ws_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\nDataCamp ( https://www.datacamp.com/ )\r\n\r\nFacebook ( https://www.facebook.com/datacampinc/ )\r\n\r\nX ( https://twitter.com/datacamp )\r\n\r\nLinkedin ( https://www.linkedin.com/school/datacampinc/ )\r\n\r\nYoutube ( https://www.youtube.com/channel/UC79Gv3mYp6zKiSwYemEik9A )\r\n\r\nInstagram ( https://www.instagram.com/datacamp/ )\r\n\r\nDataCamp, Inc. | 1 Pennsylvania Plaza | Suite 2014 | New York, NY 10119\r\n\r\nDownload on the App Store ( https://datacamp.onelink.me/xztQ/p8wathi7 )\r\n\r\nGet it on Google Play ( https://datacamp.onelink.me/xztQ/czaw6r7q )\r\n\r\nUnsubscribe ( https://www.datacamp.com/mail_preferences/dc404c34-7119-42da-b229-ad0881520dc6 )\r\n\r\nPrivacy Policy ( https://www.datacamp.com/privacy-policy )', 'Safe', '0000-00-00 00:00:00', '2024-10-14 17:19:45'),
