(652, 3, '1927703a14d13a6e', 'Get certified and prove you\'re job-ready!', 'DataCamp <team@datacamp.com>', 'Employers love DataCamp certified candidates. ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌\r\n ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌\r\n ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌\r\n\r\n****************************************************************************************************************************************************************************************************\r\nDataCamp ( https://www.datacamp.com?utm_source=customerio&utm_medium=email&utm_campaign=221214_1-nurture-t6_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ct_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n****************************************************************************************************************************************************************************************************\r\n\r\n----------------------------------\r\nGet noticed by potential employers\r\n----------------------------------\r\n\r\nCertifications from DataCamp validate your new skills and prove to employers that you\'re job-ready. Our dedicated tracks help you learn the skills needed to get certified, so it\'s never been easier.\r\n\r\nGet Certified ( https://www.datacamp.com/certification?utm_source=customerio&utm_medium=email&utm_campaign=221214_1-nurture-t6_2-b2c_3-all_4-na_5-na_6-nurturev2_7-ct_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\nBENEFITS OF CERTIFICATION\r\n\r\n \r\n\r\n* Data professionals earn more than 2x the average salary\r\n* 3x more job postings for data science roles than searches on job boards\r\n* Top 5 most in-demand jobs from hiring managers are data roles\r\n\r\nLet\'s 