(664, 3, '1926a964a38543e4', 'Archicad Essential Skills Training Batch 2. Enroll Now!', 'Architechnologies <dmabacus@thearchitechy.com>', 'Save 50% OFF from regular price until Oct. 15, 2024.\r\n\r\nhttps://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=2fb3af5050&e=85c51ace67\r\nArchicad Essential Skills Batch 2\r\nOnline Trainer-led BIM Class by Architechnologies is now open!\r\nEnroll now (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=a394cd414b&e=85c51ace67)\r\nhttps://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=8b3a7760cd&e=85c51ace67\r\nTake advantage of the ongoing Architechnologies\' 10.10 Promo and save 50% off from regular price valid until October 15, 2024 only!\r\n\r\nPay directly through our online store at: \"Architechnologies webstore (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=deef390eb4&e=85c51ace67) \".\r\n\r\nTRAINING OBJECTIVE:\r\nThis online training instructor led BIM class is developed specifically for the needs of new and beginner Archicad users. By the end of the course, participants will be able to use the software for the BIM modeling and documentation of small- medium projects.\r\n\r\nWHO SHOULD ATTEND?\r\nThis training is recommended for those who would like to get familiar with the fundamental concepts, tools and techniques of Archicad. It is suitable for architects, designers, and students of architecture without any work experience with BIM. It is also sufficient for beginner Archicad users who would like to extend their knowledge of the software.\r\n\r\nClick here for the training course outline (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=f72193a34e&e=85c51ace67) .\r\nRegister and Reserve a Seat (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=a1366156b7&e=85c51ace67)\r\nTRAINING INCLUSIONS:\r\nhttps://thearc