ail&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nCan\'t-Miss Sessions:\r\n\r\n* Data Science and Business Intelligence in 2025: How will AI Transform the Data Team?\r\n* The Payoff: Turning 2024 Data & AI Investments ROI Positive in 2025\r\n* Learning in the Age of AI: How Will AI Reshape the L&D Function in 2025?\r\n* Artificial Intelligence in 2025: Will the Rocket Continue Climbing or Will the Bubble Burst?\r\n\r\n------------------\r\nMeet Your Speakers\r\n------------------\r\n\r\nHeadshot of Anjali Samani ( https://www.datacamp.com/radar-forward-edition-2024?utm_source=customerio&utm_medium=email&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nAnjali Samani\r\n\r\nSenior Director of Data Science Analytics\r\n\r\nSalesforce\r\n\r\nHeadshot of Teena Piccione ( https://www.datacamp.com/radar-forward-edition-2024?utm_source=customerio&utm_medium=email&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nTeena Piccione\r\n\r\nGlobal Transformation & Operations Executive\r\n\r\nGoogle\r\n\r\nHeadshot of Julie De Moyer ( https://www.datacamp.com/radar-forward-edition-2024?utm_source=customerio&utm_medium=email&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nJulie De Moyer\r\n\r\nChief Data & AI Officer\r\n\r\nLVMH\r\n\r\nHeadshot of Jeff Hollan ( https://www.datacamp.com/radar-forward-edition-2024?utm_source=customerio&utm_medium=email&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nJeff Hollan\r\n\r\nHead of Applications and Developer Platform\r\n\r\nSnowflake\r\n\r\nSee Full Speaker List ( https://www.datacamp.com/radar-forward-edition-2024?utm_source=customerio&utm_medium=email&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nLearn More ( https://www.datacamp.com/radar-forward-edition-2024?utm_source=customerio&utm_medium=email&utm_campaign=241007_1-radar-t1-reg_2-b2c_3-all_4-na_5-ve_6-na_7-na_8-emal-ci_9-na_10-radar24q4_11-email&utm_content=blast&dc_euid=16231931 )\r\n\r\nDataCamp ( https://www.datacamp.com/ )\r\n\r\nFacebook ( https://www.facebook.com/datacampinc/ )\r\n\r\nX ( https://twitter.com/datacamp )\r\n\r\nLinkedin ( https://www.linkedin.com/school/datacampinc/ )\r\n\r\nYoutube ( https://www.youtube.com/channel/UC79Gv3mYp6zKiSwYemEik9A )\r\n\r\nInstagram ( https://www.instagram.com/datacamp/ )\r\n\r\nDataCamp, Inc. | 1 Pennsylvania Plaza | Suite 2014 | New York, NY 10119\r\n\r\nDownload on the App Store ( https://datacamp.onelink.me/xztQ/p8wathi7 )\r\n\r\nGet it on Google Play ( https://datacamp.onelink.me/xztQ/czaw6r7q )\r\n\r\nUnsubscribe ( https://www.datacamp.com/mail_preferences/dc404c34-7119-42da-b229-ad0881520dc6 )\r\n\r\nPrivacy Policy ( https://www.datacamp.com/privacy-policy )', 'Safe', '0000-00-00 00:00:00', '2024-10-07 21:32:30'),
