(672, 3, '1926269f93970e28', 'It’s really that easy? Yes.', 'DataCamp <team@datacamp.com>', 'DataCamp makes learning fun and efficient. ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌\r\n ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌\r\n ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌ ‌  ‌ ‌ ‌ ‌\r\n\r\n****************************************************************************************************************************************************************************************************\r\nDataCamp ( https://www.datacamp.com?utm_source=customerio&utm_medium=email&utm_campaign=221205_1-nurture-t2_2-b2c_3-all_4-na_5-na_6-nurturev2_7-le_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n****************************************************************************************************************************************************************************************************\r\n\r\nData Science Made Fun ( https://www.datacamp.com?utm_source=customerio&utm_medium=email&utm_campaign=221205_1-nurture-t2_2-b2c_3-all_4-na_5-na_6-nurturev2_7-le_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\nThere’s no better feeling than taking what you learned on DataCamp and applying it to your work or using it to open up a new career path. DataCamp makes learning fun and efficient.\r\n\r\n \r\n\r\n1\r\n\r\nLearn by Doing\r\n--------------\r\n\r\nLearn in less time by getting hands-on experience with the tools and processes you\'ll use when working with data in the real world.\r\n\r\n2\r\n\r\nDesigned to Fit Your Schedule\r\n-----------------------------\r\n\r\nOur courses are bite-sized so you can learn in a way that best fits your busy schedule. Even if you only have 5 minutes, you can learn something new each day.\r\n\r\n3\r\n\r\nWorld-Class Instructors\r\n-----------------------\r\n\r\nOur instructors come from academia and industry, are published authors and package creators, and are all pioneering leaders in their fields.\r\n\r\nKeep Making Progress ( https://www.datacamp.com?utm_source=customerio&utm_medium=email&utm_campaign=221205_1-nurture-t2_2-b2c_3-all_4-na_5-na_6-nurturev2_7-le_8-emal-ci_9-na_10-bau_11-email&utm_content=auto )\r\n\r\n \r\n\r\n-----------------------------------\r\nUnlock the Full DataCamp Experience\r\n-----------------------------------\r\n\r\nUnlock all that DataCamp has to offer, including 500+ courses, custom learning tracks, skill assessments, practice, live code-along projects, and more!\r\n\r\nUpgrade Now ( https://www.datacamp.com/pricing/b2c?utm_source=customerio&utm_medium=email&utm_campaign=221214_1-nurture_2-b2c_3-all_4-na_5-na_6-nurturev2_7-le_8-emal-ci_9-na_10-bau_11-email&utm_content=auto&utm_term=snippet )\r\n\r\nDataCamp ( https://www.datacamp.com/ )\r\n\r\nFacebook ( https://www.facebook.com/datacampinc/ )\r\n\r\nX ( https://twitter.com/datacamp )\r\n\r\nLinkedin ( https://www.linkedin.com/school/datacampinc/ )\r\n\r\nYoutube ( https://www.youtube.com/channel/UC79Gv3mYp6zKiSwYemEik9A )\r\n\r\nInstagram ( https://www.instagram.com/datacamp/ )\r\n\r\nDataCamp, Inc. | 1 Pennsylvania Plaza | Suite 2014 | New York, NY 10119\r\n\r\nDownload on the App Store ( https://datacamp.onelink.me/xztQ/p8wathi7 )\r\n\r\nGet it on Google Play ( https://datacamp.onelink.me/xztQ/czaw6r7q )\r\n\r\nUnsubscribe ( https://www.datacamp.com/mail_preferences/dc404c34-7119-42da-b229-ad0881520dc6 )\r\n\r\nPrivacy Policy ( https://www.datacamp.com/privacy-policy )', 'Safe', '0000-00-00 00:00:00', '2024-10-06 17:19:23'),
