(680, 3, '192575a85ff0e169', 'Your Android devices will soon join the Find My Device network', '\"Google\'s Find My Device\" <noreply-findmydevice@google.com>', 'The Find My Device network is coming soon\r\n\r\n\r\n\r\nYou can use Find My Device today to locate devices when they\'re connected  \r\nto the Internet. With the new Find My Device network, you\'ll be able to  \r\nlocate your devices even if they\'re offline. You can also find any  \r\ncompatible Fast Pair accessories when they\'re disconnected from your  \r\ndevice. This includes compatible earbuds and headphones, and trackers that  \r\nyou can attach to your wallet, keys or bike.\r\n\r\nTo help you find your items when they\'re offline, Find My Device will use  \r\nthe network of over a billion devices in the Android community and store  \r\nyour devices\' recent locations.\r\n\r\nHow it works\r\n\r\nDevices on the network use Bluetooth to scan for nearby items. If other  \r\ndevices detect your items, they\'ll securely send the locations where the  \r\nitems were detected to Find My Device. Your Android devices will do the  \r\nsame to help others find their offline items when detected nearby.\r\n\r\n\r\nYour devices\' locations will be encrypted using the PIN, pattern or  \r\npassword for your Android devices. They can only be seen by you and those  \r\nyou share your devices with in Find My Device. They will not be visible to  \r\nGoogle or used for other purposes.\r\n\r\n\r\nYou\'ll get a notification on your Android devices when this feature is  \r\nturned on in three days. Until then, you can opt out of the network through  \r\nFind My Device on the web. Your choice will apply to all Android devices  \r\nlinked to tierneysewali@gmail.com. After the feature has been turned on,  \r\nyou will be able to manage device participation at any time through the  \r\nFind My Device settings on the device.\r\n\r\nLearn more\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nYou received this email to update you about important changes to your  \r\nAndroid device.\r\n\r\n© 2024 Google LLC, 1600 Amphitheatre Parkway, Mountain View, CA 94043, USA\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'Safe', '0000-00-00 00:00:00', '2024-10-04 13:46:42'),
