(686, 3, '19254414a17f56e3', '[ Office Hours] Elevate your ngrok skills at our Oct. 16 livestream', 'ngrok <team@m.ngrok.com>', 'Hi Xscpry,\r\n\r\nJoel here, Senior Developer Educator at ngrok, with a question: What\'s the one big thing you want to ask about ngrok... and get answered live?\r\n\r\nWhether that\'s about tunneling localhost to a peer or deploying a rate-limited, DDoS-armored production gateway, like to invite you to join me for the second Office Hours session on Wednesday, October 16th, 2024, at 9:30 am Pacific.\r\n\r\nWhat can you expect during this session of Office Hours? In less than an hour of your time, we’ll:\r\n\r\n- Showcase answers to the technical questions you ask at registration (please do this, so we can craft demos for you!)\r\n- Open the floor to all your pressing questions in chat\r\n\r\nWe’ll all have plenty of opportunities to learn—not only as individuals, but as part of a community of developers and engineers who care about taking the complexity out of networking and ingress.\r\n\r\nReady to reserve your spot? Register here (https://d2v8tf04.na1.hubspotlinks.com/Ctc/5F+113/d2v8tf04/VW8R7d6QBtNcW1J-FYC6GGy6pW1WCq9G5lKRMKN3ypqFY3pyd0W7Y8-PT6lZ3m_W1l1jj97F3Cd-W7yG0tw1ffsL3W5X1ypX8hYQZfW62W8mK2WwhKBW6XdBDw2hbbfLW4_xLYM6cQcM_W3M0HGS5262TsVTNNZx8vLny0Vp81_46DD70DW2qbQJ91cBFBTW17WFrD3Jj1HgW8WcPJr23W-gKW5HLqX47gxNlvW6mk2pK3LtVR5W1R9Y7s32Pyt5W3k1PpX7JrTb3N2M73H-lC9vqW7CWcg36Y7VTDW3Rk5FT45sg0LW59scVS3_8V-ZN7jp5nyFc1K6N7B0wD8D1CpVW3gjskC8y_nvwW8w47Qn3Jr1QYW6gpZT83Vy27hW3fxthG70Vqkvf3-CY5b04 ) … and be sure to add any questions, feedback, or feature requests you’d like us to address during the Q&A!\r\n\r\nSign up now!\r\n(https://d2v8tf04.na1.hubspotlinks.com/Ctc/5F+113/d2v8tf04/VW8R7d6QBtNcW1J-FYC6GGy6pW1WCq9G5lKRMKN3ypqFY3pyd0W7Y8-PT6lZ3m_W1l1jj97F3Cd-W7yG0tw1ffsL3W5X1ypX8hYQZfW62W8mK2WwhKBW6XdBDw2hbbfLW4_xLYM6cQcM_W3M0HGS5262TsVTNNZx8vLny0Vp81_46DD70DW2qbQJ91cBFBTW17WFrD3Jj1HgW8WcPJr23W-gKW5HLqX47gxNlvW6mk2pK3LtVR5W1R9Y7s32Pyt5W3k1PpX7JrTb3