(697, 3, '19237f607f602977', '[Docker] You + Docker = Ready for Action', 'Docker <no-reply@notify.docker.com>', 'Hi and welcome to Docker, chanchayn!\r\n\r\nCongratulations, your account has been verified! Sign in to your Docker account at https://email.notify.docker.com/c/eJxMyTluxSAQANDTQGnBDGsxRRrfg2WIUbzJJol8-yi_-sWrXiXLjptk0h681dYDyoVciynU7KNuWJsJJeuIyLlZx7YWIzuBAqMihH8GJxeiKVUlZNSgXRNG7cfo7ZnqUb74msqxyZWWMc5b4IeAWcCczvO9Lxqdr52fm3_T2oVRn1vq6-sGLd9Z_hD8BQAA__-mwDYU to download Docker Desktop, create repositories, and invite others to collaborate with you.\r\n\r\nTo help you get started, check out the Docker documentation or launch the online tutorial to learn:\r\n\r\nKey Docker Concepts\r\nLearn Docker basics and the benefits of containerizing your applications.\r\n\r\nHow to set up your Docker environment\r\nDownload Docker Desktop, set up your Docker environment and start containerizing your applications in a few easy steps.\r\n\r\nBuild an image, and run it as a container\r\nCreate a Docker image by writing a Dockerfile, and follow the instructions to run your first container.\r\n\r\nShare your image on Docker Hub\r\nShare your image on Docker Hub so it can be easily downloaded and run on any destination machine.\r\n\r\nView Documentation at https://email.notify.docker.com/c/eJxMjkGOhCAQRU8DOwxUIeqCxSTGa0wQSiUj2kHsSd9-QqcXs6ik8t9_yQ-2JUMLJ6s66FrVdoB8sx5742ZqjZulUVoF0_faL4qom6UPwKMFCVoO0NfT2Jh-0D5Ih4QKlFmYlsdZ4vJqwul_KDf-THy3WymPi-EXg4nBFE5__eMMppWKuIrLhUKt4HSX9O1deri4HgxHkKCEHIQyIrm4r_chqD7iSTkusVqmKolCvBPD8U0_4XXe2RPD8aPybEukfNDrol-3R6blWtF7a7HbPfOnhb8AAAD__2DTXHk\r\n\r\nThank you,\r\nThe Docker Team\r\n\r\nThis email was sent to tierneysewali@gmail.com to notify you of an update that was made to your Docker Account.\r\n\r\n© 2024 Docker Inc.\r\n3790 El Camino Real #1052, Palo Alto, CA 94306\r\n', 'Safe', '0000-00-00 00:00:00', '2024-09-28 11:28:43');
