(699, 3, '192348250748ec9a', 'New in Elicit: Share Notebooks', 'Kevin Bird <kevin.bird@elicit.com>', 'Today we are excited to announce Notebook Sharing. \r\n\r\nTo start sharing a Notebook with your colleagues, simply click the \"Share\" button at the top right of a Notebook. Those that you invite by email can view your Notebook but not make changes. \r\n\r\nYou can also share your Notebook via a unique link. First, toggle on \"Anyone with the link can view\". Then, click the \"Copy link\" button to copy the shareable link to your clipboard. If you want to stop sharing, you can switch off the link sharing toggle at any time. You can also remove specific viewers by clicking the trash can icon next to their email address. Keep in mind, invitees without an Elicit account will be prompted to sign up to view your notebook. \r\n\r\n \r\n\r\nFinally, you can see all Notebooks shared with you in your Notebooks page. \r\n\r\n \r\n\r\nWe hope this will make sharing your research much easier! \r\n\r\nKevin Bird\r\n\r\nHead of Product\r\n\r\nHelp Center ( https://support.elicit.com/?utm_source=email )\r\n\r\nElicit Tutorials ( https://www.youtube.com/@elicit-research/?utm_source=email )\r\n\r\nYou are receiving this email because you signed up for Elicit ( https://elicit.com/?utm_source=email ), an AI research assistant. 440 N Barranca Ave, #1595, Covina, CA 91723. You can manage email preferences here ( http://track.customer.io/manage_subscription_preferences/dgTd9ggDAK3ibqzibgGSNG-QS7CchGSHTVmiVjA= ). View this email online here ( http://track.customer.io/deliveries/dgTd9ggDAK3ibqzibgGSNG-QS7CchGSHTVmiVjA= ).', 'Safe', '0000-00-00 00:00:00', '2024-09-27 19:23:28'),
(700, 3, '1922dc4fa6a0cb1b', 'minimalist phone: Screen Time subscription suspended due to payment issue', 'Google Play <googleplay-noreply@google.com>', 'Google Play\r\n\r\n\r\nYour subscription will be cancelled\r\n\r\n\r\nUPDATE PAYMENT\r\n\r\n\r\nHi Kaoru,\r\nYour payment from GCash: 63-9****83731 was declined.\r\n\r\nUpdate your payment method to get all of the benefits provided by Full  \r\nversion - minimalist phone (minimalist phone: Screen Time) back. These  \r\nbenefits include the following:\r\n\r\nUnlimited number of favorite apps\r\nUnlimited number of hidden apps\r\nUnlimited number of renamed apps\r\nCustom color themes\r\nTo keep these benefits, you\'ll need to keep your subscription active.  \r\nUpdate your payment method or use a different one.\r\nIn the meantime, we\'ll try to process the payment again so you can regain  \r\naccess to your subscription. Manage your subscriptions\r\n\r\n\r\nSUMMARY\r\n\r\n\r\n\r\nAmount Due ₱60.00\r\n\r\n\r\nUPDATE PAYMENT\r\n\r\n\r\nLearn more\r\n\r\n\r\nThanks,\r\nThe Google Play team\r\n\r\n\r\nSee your Google Play Order History.\r\nView the Google Play Refund Policy and the Terms of Service.\r\n\r\n\r\n\r\n\r\nGoogle Asia Pacific Pte. Limited, 70 Pasir Panjang Road, #03-71, Mapletree  \r\nBusiness City, Singapore 117371\r\n\r\n\r\n', 'Safe', '0000-00-00 00:00:00', '2024-09-26 11:58:56');
