(703, 3, '19228b3ca1d2f04a', '8 Days Left. Official Launching of progeCAD 2025 in the Philippines!', 'progeCAD Philippines <dmabacus@thearchitechy.com>', 'Discover how progeCAD can enchance your AEC Business.\r\n\r\nhttps://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=fbdaa1dca7&e=85c51ace67\r\n\r\n\r\n** Grow Your Business with progeCAD\r\n------------------------------------------------------------\r\nhttps://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=1be91b43e4&e=85c51ace67\r\nOfficial launch of progeCAD 2025 in the Philippines\r\n\r\nJoin us for an exclusive webinar where we’ll show you how progeCAD 2025 Professional (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=9e655e5f8f&e=85c51ace67) can help you grow your AEC business with powerful tools, improved productivity, and sustainable solutions. This is your chance to be among the first to explore the latest features and advancements of this cutting-edge CAD software.\r\nOctober 2024\r\n3\r\nSIGN UP (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=af094b6779&e=85c51ace67)\r\n\r\nWhat You’ll Learn:\r\n* How progeCAD 2025 Professional can transform your workflow\r\n* New features and tools designed for maximum productivity\r\n* Live demo showcasing the progeCAD\'s capabilities\r\n* Tips for enhancing sustainability in your AEC projects\r\n* Q&A session to answer all your questions\r\n\r\nWhy You Should Attend:\r\n\r\nIf you\'re in the AEC industry and looking for innovative, cost-effective solutions to improve your business, this webinar is for you.\r\n\r\nDon\'t miss this opportunity to stay ahead in the competitive CAD landscape!\r\n9 DAYS LEFT TO REGISTER! (https://thearchitechy.us20.list-manage.com/track/click?u=098c47b1bd2b6728d4fc8fb19&id=1dc74099a5&e=85c51ace67)\r\nCebu Main Office:\r\n\r\nUnit 401 JRDC Bldg., Osmeña Blvd., Capitol Site, Cebu City, Cebu, 6000, Philip