(714, 3, '19218585176ddcdc', 'Your PayPal verification code', '\"service@intl.paypal.com\" <service@intl.paypal.com>', '<html dir=\"ltr\" lang=\"en\">\n\n  <head>\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n    <meta name=\"viewport\" content=\"initial-scale=1.0,minimum-scale=1.0,maximum-scale=1.0,width=device-width,height=device-height,target-densitydpi=device-dpi,user-scalable=no\" />\n    <title>Your PayPal verification code</title>\n    <style type=\"text/css\">\n      /**\n * PayPal-Open Fonts\n */\n      /* Body text - font-weight:400 */\n      @font-face {\n        font-family: PayPal-Open;\n        font-style: normal;\n        font-weight: 400;\n        src: url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Regular.otf\') format(\"opentype\");\n        /* IE9 Compat Modes */\n        src: url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Regular.woff2\') format(\'woff2\'),\n          /*Moderner Browsers*/\n          url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Regular.woff\') format(\'woff\');\n        /* Modern Browsers */\n        /* Fallback font for - MS Outlook older versions (2007,13, 16)*/\n        mso-font-alt: \'Calibri\';\n      }\n\n      /* Headline/Subheadline/Button text font-weight:500 */\n      @font-face {\n        font-family: PayPal-Open;\n        font-style: normal;\n        font-weight: 500;\n        src: url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Medium.otf\') format(\"opentype\");\n        /* IE9 Compat Modes */\n        src: url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Medium.woff2\') format(\'woff2\'),\n          /*Moderner Browsers*/\n          url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Medium.woff\') format(\'woff\');\n        /* Modern Browsers */\n        /* Fallback font for - MS Outlook older versions (2007,13, 16)*/\n        mso-font-alt: \'Calibri\';\n      }\n\n      /* Bold text - <b>, <strong> Bold equals to font-weight:700 */\n      @font-face {\n        font-family: PayPal-Open;\n        font-style: normal;\n        font-weight: 700;\n        src: url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Bold.otf\') format(\"opentype\");\n        /* IE9 Compat Modes */\n        src: url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Bold.woff2\') format(\'woff2\'),\n          /*Moderner Browsers*/\n          url(\'https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/fonts/PayPalOpen/PayPalOpen-Bold.woff\') format(\'woff\');\n        /* Modern Browsers */\n        /* Fallback font for - MS Outlook older versions (2007,13, 16)*/\n        mso-font-alt: \'Calibri\';\n      }\n\n      /* End - PayPal-Open Fonts */\n\n      /**\n * VX-LIB Styles \n * Import only the styles required for Email templates.\n */\n      @charset \"UTF-8\";\n\n      html {\n        box-sizing: border-box;\n      }\n\n      *,\n      *:before,\n      *:after {\n        box-sizing: inherit;\n      }\n\n      /* Setting these elements to height of 100% ensures that\n * .vx_foreground-container fully covers the whole viewport\n */\n      html,\n      body {\n        height: 100%;\n      }\n\n      body {\n        font-size: 14px !important;\n        font-family: PayPal-Open, \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n        -webkit-font-smoothing: antialiased;\n        -moz-osx-font-smoothing: grayscale;\n        font-smoothing: antialiased;\n      }\n\n      a,\n      a:visited {\n        color: #0070E0;\n        text-decoration: none;\n        font-weight: 500;\n        font-family: PayPal-Open, \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n      }\n\n      a:active,\n      a:focus,\n      a:hover {\n        color: #003087;\n        text-decoration: underline;\n      }\n\n      p,\n      li,\n      dd,\n      dt,\n      label,\n      input,\n      textarea,\n      pre,\n      code,\n      table {\n        font-size: 14px;\n        line-height: 1.6;\n        font-weight: 400;\n        text-transform: none;\n        font-family: PayPal-Open, \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n        color: #001435;\n      }\n\n      .vx_legal-text {\n        font-size: 0.8125rem;\n        line-height: 1.38461538;\n        font-weight: 400;\n        text-transform: none;\n        font-family: PayPal-Open, \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n        color: #6c7378;\n      }\n\n      /* End - VX-LIB Styles */\n\n      /**\n * Styles from Neptune\n */\n      /* prevent iOS font upsizing */\n      * {\n        -webkit-text-size-adjust: none;\n      }\n\n      /* force Outlook.com to honor line-height */\n      .ExternalClass * {\n        line-height: 100%;\n      }\n\n      td {\n        mso-line-height-rule: exactly;\n      }\n\n      /* prevent iOS auto-linking */\n      /* Android margin fix */\n      body {\n        margin: 0;\n        padding: 0;\n      }\n\n      div[style*=\"margin: 16px 0\"] {\n        margin: 0 !important;\n      }\n\n      /** Prevent Outlook Purple Links **/\n      .greyLink a:link {\n        color: #949595;\n      }\n\n      /* prevent iOS auto-linking */\n      .applefix a {\n        /* use on a span around the text */\n        color: inherit;\n        text-decoration: none;\n      }\n\n      .ppsans {\n        font-family: PayPal-Open, \'Helvetica Neue\', Helvetica, Arial, sans-serif !important;\n      }\n\n      /* use to make image scale to 100 percent */\n      .mpidiv img {\n        width: 100%;\n        height: auto;\n        min-width: 100%;\n        max-width: 100%;\n      }\n\n      .stackTbl {\n        width: 100%;\n        display: table;\n      }\n\n      /* Responsive CSS */\n      @media screen and (max-width: 640px) {\n\n        /*** Image Width Styles ***/\n        .imgWidth {\n          width: 20px !important;\n        }\n      }\n\n      @media screen and (max-width: 480px) {\n\n        /*** Image Width Styles ***/\n        .imgWidth {\n          width: 10px !important;\n        }\n      }\n\n      /* End - Responsive CSS */\n\n      /* Fix for Neptune partner logo */\n      .partner_image {\n        max-width: 250px;\n        max-height: 90px;\n        display: block;\n      }\n\n      /* End - Styles from Neptune */\n\n      /**\n * Styles - overrides for PayPal rebranding\n */\n      html,\n      body {\n        background: #FAF8F5;\n        color: #001435;\n        font-size: 14px;\n        line-height: 1.6;\n      }\n\n      .footerDivider {\n        margin: 0px 35px;\n      }\n\n      /* Button  */\n      td.paypal-button-primary:hover {\n        /*Setting border to td would increase the buttton size on hover */\n        background-color: #0070E0 !important;\n      }\n\n      a.paypal-button-primary:hover {\n        background-color: #0070E0 !important;\n        border: 2px solid #0070E0 !important;\n      }\n\n      a.paypal-button-secondary:hover {\n        border: 2px solid #0070E0 !important;\n        color: #0070E0 !important;\n      }\n\n      a.paypal-button-branded:hover {\n        background-color: #FFE888 !important;\n        border: 2px solid #FFE888 !important;\n      }\n\n      /**\n * Styles for Dark mode\n */\n      @media (prefers-color-scheme: dark) {\n\n        /* Wrap entire logo with border */\n        .footerDivider {\n          margin-left: 0px\n        }\n      }\n    </style>\n  </head>\n\n  <body>\n    <h4 id=\"preHeader\" style=\"display:none;color:#FAF8F5;font-size:0px;line-height:0px\">Elizabeth Layaging, this code expires in 10 minutes.</h4>\n    <table cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" width=\"100%\">\n      <tbody>\n        <tr>\n          <td bgcolor=\"#FAF8F5\" style=\"font-size:0px\"></td>\n          <td bgcolor=\"#FAF8F5\" width=\"640\" align=\"center\" class=\"mobContent\">\n            <table cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" width=\"100%\" dir=\"ltr\">\n              <tbody>\n                <tr>\n                  <td>\n                    <table cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" width=\"100%\">\n                      <tbody>\n                        <tr>\n                          <td>\n                            <table width=\"100%\" cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" style=\"background:#fff\" dir=\"ltr\">\n                              <tbody>\n                                <tr>\n                                  <td style=\"color:#687173;font-weight:500;font-size:14px;line-height:20px;padding:10px\"><span>Hello, Elizabeth Layaging</span></td>\n                                </tr>\n                              </tbody>\n                            </table>\n                          </td>\n                        </tr>\n                        <tr>\n                          <td>\n                            <table width=\"100%\" cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" dir=\"ltr\">\n                              <tbody>\n                                <tr>\n                                  <td style=\"padding:15px 20px 25px 20px\"><img src=\"https://www.paypalobjects.com/digitalassets/c/system-triggered-email/n/layout/images/paypal-rebranding/pp-logo-in-circle-2x.png\" style=\"display:block\" border=\"0\" width=\"63\" height=\"63\" alt=\"PayPal\" title=\"PayPal\" /></td>\n                                </tr>\n                              </tbody>\n                            </table>\n                          </td>\n                        </tr>\n                      </tbody>\n                    </table>\n                  </td>\n                </tr>\n              </tbody>\n            </table>\n            <table cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" width=\"100%\" class=\"ppsans\" dir=\"ltr\">\n              <tbody>\n                <tr>\n                  <td width=\"640\" valign=\"top\">\n                    <table width=\"100%\" cellSpacing=\"0\" cellPadding=\"0\" border=\"0\" style=\"word-break:break-word\">\n                      <tbody>\n                        <tr>\n                          <td style=\"padding:0px 35px 30px 35px\">\n                            <p class=\"ppsans\" style=\"font-size:32px;font-weight:500;line-height:38px;color:#001C64;margin:0\" dir=\"ltr\"><span>Here\'s your code</span></p>\n                          </td>\n                        </tr>\n                      </tbody>\n                    </table>\n                    <table width=\"100%\" cellPadding=\"0\" cellSpacing=\"0\" border=\"0\">\n                      <tbody>\n                        <tr>\n                          <td align=\"center\" class=\"ppsans\" style=\"padding:0px 35px 25px 35px\">\n                            <p class=\"ppsans\" style=\"font-size:14px;line-height:20px;color:#001435;margin:0;word-break:break-word\" dir=\"ltr\"><span>Your verification code is 076086 and will expire in 10 minutes. For your security, don\'t share it with anyone. PayPal will never call to ask you for this info.</span></p>\n                          </td>\n                        </tr>\n                      </tbody>\n                    </table>\n                  </td>\n                </tr>\n                <tr>\n                  <td width=\"640\">\n                    <table width=\"100%\" cellPadding=\"0\" cellSpacing=\"0\" border=\"0\" dir=\"ltr\">\n                      <tbody>\n                        <tr>\n                          <td>\n                            <table width=\"100%\" cellPadding=\"0\" cellSpacing=\"0\" border=\"0\">\n                              <tbody>\n                