(715, 3, '19217ba4726fe29c', 'More related to \"What is the relationship of the Cavite mutiny to the Gomburza?\"', 'Quora <curiosity-noreply@quora.com>', 'Stories from your activity\r\n\r\n-----\r\n\r\nQuestion: How did the Cavite Mutiny lead to the execution of the GomBurZa?\r\n\r\n\r\nAnswer from John Hopkins\r\n\r\n\r\nThe three Filipino Priests were garroted by the Spanish kahunas. I suppose they (the Spanish) believed the GomBurZa were undermining their (the Spanish) authority.\r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8MXwxfDI5MDgyNzUyMyJ9&al_pri=8&aoid=o5BJBVfHhD&aoty=1&aty=4&cp=1&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=o5BJBVfHhD&uid=muXnTJGfeby&v=0\r\n-----\r\nQuestion: How relevant is the Cavite mutiny significant to our present time?\r\n\r\n\r\nAnswer from Benchz Quitolbo\r\n\r\n\r\nCavite Mutiny is known to be the uprising and revolution of troops and workers at Cavite where Filipino workers fought against Spanish troops due to Spanish repression. As \r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8MnwxfDMwOTY4MDY0NSJ9&al_pri=8&aoid=ZQEfbLmTdm&aoty=1&aty=4&cp=2&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=ZQEfbLmTdm&uid=muXnTJGfeby&v=0\r\n-----\r\nQuestion: How did the Cavite mutiny and the Gomburza martyrdom contribute to the growth of the Filipino nationalism and decline the Spanish rule?\r\n\r\n\r\nAnswer from Al Suvarnadvipa dan Argentum\r\n\r\n\r\nIf you want more information on the Pre-colonial half of Filipino History here’s the right person that I know can adequately answer your questions Dayang Marikit [ https:/ \r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8M3wxfDM0NTYwNDU5MSJ9&al_pri=8&aoid=m27ybg4QUR6&aoty=1&aty=4&cp=3&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=m27ybg4QUR6&uid=muXnTJGfeby&v=0\r\n-----\r\nQuestion: What caused the Cavite Mutiny?\r\n\r\n\r\nAnswer from George S. Hawkins IV\r\n\r\n\r\nThe 1872 Cavite Muntiny was precipitated by long-standing personal benefits to the workers such as tax (tribute) and forced labor exemptions on order from the Governor Gen \r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8NHwxfDI1MDAwNDkxMyJ9&al_pri=8&aoid=R8LZghtQLki&aoty=1&aty=4&cp=4&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=R8LZghtQLki&uid=muXnTJGfeby&v=0\r\n-----\r\nQuestion: Is Cavite Mutiny an event that led to the execution of the Gomburza?\r\n\r\n\r\nAnswer from Ramesh Kumar Verma\r\n\r\n\r\nThe mutiny was used by the colonial government and Spanish friars to implicate three secular priests, Mariano Gomez, José Burgos, and Jacinto Zamora, collectively known as \r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8NXwxfDI4MzUyNDEwNiJ9&al_pri=8&aoid=7QiTOwozRr&aoty=1&aty=4&cp=5&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=7QiTOwozRr&uid=muXnTJGfeby&v=0\r\n-----\r\nQuestion: How did the Cavite Mutiny and Gom-Bur-Za execution shape Rizal\'s ideas and decisions?\r\n\r\n\r\nAnswer from Associate Professor Ruben P. Quitolbo\r\n\r\n\r\nIn the late 19th century Filipinos were deeply affected by the execution of GOMBURZA and the deaths in the Cavite mutiny; José Rizal, who would eventually become the count \r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8NnwxfDMwOTc1NzIyNyJ9&al_pri=8&aoid=3Ef4tej8RN6&aoty=1&aty=4&cp=6&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=3Ef4tej8RN6&uid=muXnTJGfeby&v=0\r\n-----\r\nQuestion: How does Governor Gen. Izquierdo describe Cavite Mutiny compared to the version of Dr. Pardo de Tavera?\r\n\r\n\r\nAnswer from Wushin Wang\r\n\r\n\r\nThe beginning of the Philippine Revolution against Spanish colonial rule was, in my opinion, marked by the Cavite Mutiny of 1872, which was a significant event in Philippi \r\nRead More: https://www.quora.com/qemail/track_click?al_imp=eyJ0eXBlIjogMzMsICJoYXNoIjogIjB8N3wxfDE0Nzc3NDM2NTIzMDU2MTcifQ%3D%3D&al_pri=8&aoid=YXTAPgo08fW&aoty=1&aty=4&cp=7&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source=7&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty=1&ty_data=YXTAPgo08fW&uid=muXnTJGfeby&v=0\r\n-----\r\n\r\n-----\r\n\r\nTo control which emails we send you, visit: https://www.quora.com/qemail/track_click?aoid&aoty=14&aty=4&cp=0&ct=1726974933758365&et=130&id=34302ba4e5aa46499df3474e85c91f89&inject=1&source&src=1&st=1726974933775808&stories=1_o5BJBVfHhD%7C1_ZQEfbLmTdm%7C1_m27ybg4QUR6%7C1_R8LZghtQLki%7C1_7QiTOwozRr%7C1_3Ef4tej8RN6%7C1_YXTAPgo08fW&ty&ty_data&uid=muXnTJGfeby&v=0\r\n\r\nTo unsubscribe from this type of email, visit: https://www.quora.com/email_optout/qemail_unsubscribe?email_track_id=34302ba4e5aa46499df3474e85c91f89&t=1726974933861134&token=401f595665253d0fe76adf68aa03fff4ef95c2f0ffdf04186b3d077b6e560bc2c73f920a9ce3a2df973a3d24972a539d393b2fc0e41dd57219bfbcc1ef9a8266&type=130&uid=1725364721', 'Safe', '0000-00-00 00:00:00', '2024-09-22 05:15:36'),
(716, 3, '19217660126970c7', 'What’s new in September: Reminders for all', 'The Todoist Monthly <no-reply@todoist.com>', 'What’s new in September: Reminders for all\r\nEffortlessly remember everything\r\n ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌\r\n‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿ ‌ ‍‎‏﻿\r\n\r\nDisplay in your browser\r\n[https://todoist.doist-emails.com/en/emails/todoist/cms/TDMonthly0924?%3D&s=6qX71o0ju4mTDjbWZPfdirzvVnIItFeGTNan1Uc99sQ]\r\n\r\nTodoist logo\r\n[https://todoist.doist-emails.com/_next/static/images/todoist-logo_72b3fc1c96843f71fb23350260f1d64d.png]\r\n\r\n[https://images.ctfassets.net/5zyjowl7hbbz/4j6qXrqpKdbrsYZjK08rNH/2d60734a78d4d9e98529a94f7d3d2d1c/Free_Reminders.png?w=1100&fm=png]\r\n\r\nThe Todoist Monthly\r\n\r\n \r\n\r\nAll that’s new in the Todoist-verse – September 2024\r\n\r\n--------------------------------------------------------------------------------\r\n\r\n \r\n\r\nFor many of us, September is the epitome of busyness. But keeping up with your\r\nto-do list during these hectic times doesn’t have to be a headache. 💆\r\n\r\n \r\n\r\nBehold (...dramatic pause)\r\n\r\n \r\n\r\n✨Reminders✨ (cue oohs and ahhs 😲)\r\n\r\n \r\n\r\nReminders, now free for everyone\r\n\r\n \r\n\r\nReminders are a gentle nudge that resurfaces a task to keep you on track. When\r\nyou set a due time for a task – like \"Write the report at 10am\" – Todoist will\r\nautomatically set a reminder for you. You’ll receive a notification when the\r\ntask is due.\r\n\r\n \r\n\r\nHere’s a short demo from\r\n[https://res.cloudinary.com/imagist/image/fetch/f_png/c_scale,h_48,w_48/r_max/https://images.ctfassets.net/5zyjowl7hbbz/55U6uaGVtXeVVzEaR2TnH9/d8c8d93bab05a6ce5ca8e9271d9cf68d/Avatar__Doisters__Jon.png?_a=DATAdtJsZAA0]\r\nJon on how they work 👇\r\n\r\n \r\n[https://images.ctfassets.net/5zyjowl7hbbz/16eogNqYGuJtiFcF6EPkW5/8621e26c3290d6889bde0e45a37ff8a0/BasicReminders.png?w=1100&fm=png]https://youtube.com/shorts/SWOEu9P4bmg?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly\r\n\r\n \r\n\r\nGetting started really is as easy as creating a task and assigning it a due date\r\nand time. Try it now:\r\n\r\n \r\n\r\n 1. Open Todoist\r\n\r\n 2. Add a time-sensitive task that’s been taking up precious headspace (like\r\n    \"Submit my expenses tomorrow at 9am\", or \"Call Susan on Tues at 4pm\").\r\n\r\n 3. Move on with your day, and rest easy knowing you’ll be reminded when the\r\n    time is right. 🧘‍♂️\r\n\r\n \r\n\r\nOpen your Todoist\r\n[https://app.todoist.com/?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]\r\n\r\n \r\n\r\n[https://todoist.doist-emails.com/_next/static/images/lightbulb-yellow_6f87d099bc73d60aa043989251b3a548.png]\r\n\r\nTip\r\n\r\n \r\n\r\nAutomatic reminders can be sent via push notification, desktop notification, or\r\nemail. By default you’ll receive push and desktop notifications. Adjust this\r\n(and more) by heading to Settings > Reminders wherever you use Todoist.\r\n\r\n \r\n\r\nMore memory joggers\r\n\r\n \r\n\r\nGetting notified when a task’s due time rolls around is a powerful thing. Here\r\nare three other automated tools in your Todoist toolbox that can also make\r\nremembering tasks feel effortless:\r\n\r\n \r\n\r\n * Start the day with a Daily Digest email every morning with personalized\r\n   productivity stats plus your tasks for today. Enable it via Settings >\r\n   Notifications on the web or desktop apps.\r\n\r\n * Get a nudge to organize your tasks for the day with a Morning Overview\r\n   notification sent to your phone. Switch it on and customize the timing in the\r\n   mobile app’s Notifications settings.\r\n\r\n * Make sure nothing’s slipped through the cracks with an Evening Review mobile\r\n   notification. Another customizable, timely prompt that keeps you feeling on\r\n   top of it all. 👑\r\n\r\n \r\n[https://images.ctfassets.net/5zyjowl7hbbz/4Wrb7sayy4vz5xda9fgUj0/ae49b68b3c2cb51d081d7d2fe2eb8702/DailyDigest.png?w=1100&fm=png]\r\n\r\n \r\n\r\nReminding like a Pro\r\n\r\n \r\n\r\nUpgrading to a paid plan\r\n[https://todoist.com/pricing?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]\r\n(Pro or Business) unlocks so many more ways to make reminders work exactly how\r\nyou need:\r\n\r\n \r\n\r\n * Adjust how long an automatic reminder is sent before a task so you get the\r\n   perfect amount of notice every time.\r\n\r\n * Add multiple reminders to a single task when it needs that extra bit of\r\n   attention-grabbing (like remembering a dentist appointment 😬).\r\n\r\n * Use location-based reminders\r\n   [https://todoist.com/help/articles/use-location-reminders-in-todoist-uGcwH2AJ6?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]\r\n   to get nudged about a task when you leave or arrive at a specific place, like\r\n   heading to the office or arriving at the grocery store.\r\n\r\n * In addition to adding a reminder when a task is due, users on paid plans can\r\n   create custom reminders for specific times (\"in 5 days\") or even make them\r\n   recurring (\"every Monday at 9am\").\r\n\r\n * Use the shortcut ! when creating or editing a task to quickly add a reminder\r\n   as you type (\"!30mb\" or \"!30min before\").\r\n\r\n \r\n\r\nCheck out a quick tour of Pro Reminders\r\n[https://youtube.com/shorts/5TAVwxB8OX0?si=Gwkj9jaZAlMsNW0P&utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]\r\nby\r\n[https://res.cloudinary.com/imagist/image/fetch/f_png/c_scale,h_48,w_48/r_max/https://images.ctfassets.net/5zyjowl7hbbz/5WmgSlBN4TCs0OH4lPqAGB/ae6ae1ed91017bc008db5d4a3a013302/heather.png?_a=DATAdtJsZAA0]\r\nHeather. 🍿\r\n\r\n \r\n[https://images.ctfassets.net/5zyjowl7hbbz/21tQS6shHxbaQpnaPO08gD/e494df62ae28e595e375c8dcbd12fe59/ProReminders.png?w=1100&fm=png]https://youtube.com/shorts/5TAVwxB8OX0?si=Gwkj9jaZAlMsNW0P&utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly\r\n\r\n \r\n\r\nFree Reminders, finally\r\n\r\n \r\n\r\nFor over a decade, Reminders have been a cornerstone of our paid plans. But as a\r\ncompany we’ve been building momentum and improving the health of our business\r\n(we don’t have billion-dollar investors and are fully bootstrapped, after all!).\r\n\r\n \r\n\r\nIt’s because of your continued support that we can make basic Reminders\r\navailable on all plans, for free. And we thank you for it! 🙏\r\n\r\n \r\n\r\nUntil next time! 👋\r\n\r\n \r\n\r\nProductively,\r\n\r\n[https://todoist.doist-emails.com/_next/static/images/signature_ff6d562960d845568a95d42ffe0aac71.png]\r\n\r\nTwitter\r\n[https://todoist.doist-emails.com/_next/static/images/twitter-grey_f4a63fb2a3580924f3955122bddc0ddc.png]https://x.com/todoist?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthlyInstagram\r\n[https://todoist.doist-emails.com/_next/static/images/instagram-grey_9f17f3786472f183f76594ec3280e6c2.png]https://www.instagram.com/todoistofficial?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthlyLinkedIn\r\n[https://todoist.doist-emails.com/_next/static/images/linkedin-grey_ac9c8a4899d2a8c2fe841f7b109a77ce.png]https://www.linkedin.com/showcase/todoist/?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthlyYouTube\r\n[https://todoist.doist-emails.com/_next/static/images/youtube-grey_1a80210b7cac05c361115e118e57a816.png]https://www.youtube.com/channel/UCQ_61yRKscCnkIJBPoR15EA?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly\r\n\r\nInspiration Hub\r\n[https://todoist.com/inspiration?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]   |   Download\r\nApps\r\n[https://todoist.com/downloads?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]   |   Help\r\nCenter\r\n[https://todoist.com/help?utm_source=todoist&utm_medium=email&utm_campaign=2024_09_todoist_monthly]\r\n\r\nUnsubscribe\r\n[https://todoist.com/unsubscribe?m_type=1&token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1aWQiOjQ1OTg4NjQxLCJzdWIiOiJtYWlsX3Vuc3ViIiwianRpIjoiYVFVdm5idVEiLCJleHAiOjE3Mjk1NjE0MTB9.nsBUqW5BINF3aed0pq-NC4pY3NSPCeRmPE70h5Xrj1c]\r\n\r\n© Doist Inc. 2100 Geng Road, Suite 210 Palo Alto, CA 94303 US', 'Safe', '0000-00-00 00:00:00', '2024-09-22 03:43:31'),
