(730, 4, '192a4e804cacf405', 'Limited-Time Awareness Month Offer: $1.99 Per Cybersecurity Course!', 'EC-Council Learning <learn@eccouncil.org>', 'Free Bonus Inside: AI Skills Packhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email7  \r\n\r\nDid you miss our last email? No problem! We’ve added an \r\n\r\n**exciting surprise: The AI Skills Pack, FREE** when you purchase our Awareness Month bundle today! \r\n\r\nLooking for specific skills? We’ve got you covered—buy \r\n\r\n**any course for just $1.99!**\r\n\r\nDon’t wait—these incredible offers won’t be around for long! \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email7  \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email7  \r\n\r\n**A Quick Look at the Skill-Enhancing Courses\r\nYou’ll Get for Just $1.99 Each** \r\n\r\n**Free Bonus You’ll Get with the Bundle** \r\n\r\n**The Ultimate AI Skills Pack: ChatGPT + Gemini** \r\n\r\nThis complimentary bonus pack includes four courses designed to enhance your AI skills alongside your cybersecurity training, making it an invaluable addition to your skill set. \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email7  \r\n\r\n**The Regular Price of this Bundle is $299!** \r\n\r\n**Get This Exclusive Bundle Today for Just:**\r\n\r\n**$19.99** \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email7  \r\n\r\n**Still Thinking? Here Is Some Additional Information to Help You Make an Informed Decision** \r\n\r\n \r\n\r\n**Why are these courses so affordable? Will there be any hidden charges?** \r\n\r\n \r\n\r\nRest assured, there are no hidden charges. Every year, we at EC-Council go all out to celebrate Cybersecurity Awareness Month and help professionals access courses at a minimal cost. We want to empower more people to embrace a cybersecurity career and build a safer online world in the process.\r\n\r\n \r\n\r\n**Are the courses beginner-friendly?** \r\n\r\n \r\n\r\nThey are designed for all skill levels, including beginners.\r\n\r\n \r\n\r\n**Are these online courses?** \r\n\r\n \r\n\r\nYes, all courses are fully online.\r\n\r\n \r\n\r\n**Can I take the courses at my own pace?** \r\n\r\n \r\n\r\nYes, all courses are self-paced, allowing you to learn on your schedule. \r\n\r\n \r\n\r\n**How long will I have access to these courses?** \r\n\r\n \r\n\r\nYou\'ll have access to the entire bundle for one year, including any updates.\r\n\r\n \r\n\r\n**Why is microlearning good for me?** \r\n\r\n \r\n\r\nMicrolearning helps you learn quickly in small, focused sessions, fitting easily into your busy schedule while helping you build in-demand skills faster. Consistency makes all the difference!\r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email7  \r\n\r\nhttps://www.facebook.com/ECCouncilLearning \r\n\r\nhttps://twitter.com/ECC_Learning \r\n\r\nhttps://www.linkedin.com/company/ec-council-learning/ \r\n\r\nhttps://www.youtube.com/@ECCouncil-Learning  \r\n\r\n**Copyright © 2024** EC-Council https://www.eccouncil.org | Privacy Statement https://codered.eccouncil.org/privacy-policy\r\n_________________\r\n\r\nSent to: qb202100057@wmsu.edu.ph\r\n\r\nUnsubscribe:\r\nhttp://eccouncil34531.activehosted.com/proc.php?nl=6&c=2096&m=2143&s=bff076bd4894e925f8d87d767a64c24e&act=unsub\r\n\r\nEC-Council International Limited, Sun Ave NE 101C, Albuquerque, New Mexico 87109, United States', 'Safe', '0000-00-00 00:00:00', '2024-10-19 15:12:01'),
