(740, 4, '1929f22431f6d28c', '[Product update] Database Backups', 'Eldad Fux <eldad@appwrite.io>', 'Hi there,\r\r\n\r\r\nWe have a new feature for Databases that we are excited to share with you: Database Backups. \r\r\n\r\r\nWhether you’re running production workloads or handling large datasets, Appwrite now makes it easier to back up your databases, securely and efficiently with just a few clicks on your Appwrite Console. It is designed to give you full control over the safety and recoverability of your data without any downtime. \r\r\n\r\r\nThis is also a crucial milestone for Appwrite Cloud to get closer to the much anticipated GA release.\r\r\n\r\r\nRead the official announcement on our blog ( https://link.userlistmail.com/c/f9a73ef3a3cbcbbf17a532ec8a2f16f59bf1eb44b8a6d03ff573737131c5d1636ebf42689eba7714e74669c68a29924284177629087da6310e18e2476f0b416db36c99d1a66ebd45fc2f244096d172c29fd1aa540f3d53add2f3b3c0380b0fde ).\r\r\n\r\r\nWhat is Database Backups?\r\r\n\r\r\nAppwrite Database Backups help you back up your database with minimal impact on your production performance, ensuring your operations continue smoothly.\r\r\n\r\r\n- Encrypted backups: All database backups are fully encrypted both in transit and at rest. This encryption protects your sensitive information from unauthorized access or breaches.\r\r\n- Hot backups: All database backups are hot, meaning they are created without causing any downtime or interruptions to your services. This is especially critical for production environments where uptime and performance are key.\r\r\n- Remote backups: Backups are stored in a geographically separate location, isolated from our primary data center in Frankfurt. This ensures full redundancy and strengthens your disaster recovery strategy.\r\r\n\r\r\nAvailable on Pro, Scale, and Enterprise plans\r\r\n\r\r\nThe new feature will be available on all paid plans with some added customization on Scale and Enterprise.\r\r\n\r\r\n- Pro plan: daily backups logged for 7 days\r\r\n- Scale and Enterprise: custom backup policies\r\r\n\r\r\nLearn more about the difference in our announcement ( https://link.userlistmail.com/c/f9a73ef3a3cbcbbf17a532ec8a2f16f59bf1eb44b8a6d03ff573737131c5d1636ebf42689eba7714e74669c68a29924284177629087da6310e18e2476f0b416db36c99d1a66ebd45fc2f244096d172c29fd1aa540f3d53add2f3b3c0380b0fde ) and pricing page ( https://link.userlistmail.com/c/f9a73ef3a3cbcbbf17a532ec8a2f16f59bf1eb44b8a6d03ff573737131c5d1636ebf42689eba7714e74669c68a29924284177629087da6310e18e2476f0b416d74e23c6e8c614a12985c1aef75daaa3cc474dc72730f2bdf3afc38607592e4f7 ).\r\r\n\r\r\nTo get started, visit our documentation ( https://link.userlistmail.com/c/f9a73ef3a3cbcbbf17a532ec8a2f16f59bf1eb44b8a6d03ff573737131c5d1636ebf42689eba7714e74669c68a29924284177629087da6310e18e2476f0b416db36c99d1a66ebd45fc2f244096d172c25cc4694d1f49ea84949a794a6c65a82c ). We look forward to your feedback!\r\r\n\r\r\nHappy coding!\r\r\n\r\r\n\r\r\nEldad Fux\r\r\nFounder & CEO\r\r\n\r\r\nhttps://link.userlistmail.\r\r\n\r\r\n@eldadfux ( https://link.userlistmail.com/c/f9a73ef3a3cbcbbf17a532ec8a2f16f59bf1eb44b8a6d03ff573737131c5d1636ebf42689eba7714e74669c68a29924284177629087da6310e18e2476f0b416d591f4c669a77691610d3f3b0c148a59ba5ca15f6c2904f958828c557e1d03194 )\r\r\n\r\r\n\r\r\n https://link.userlistmail.\r\r\n\r\r\n https://link.userlistmail.\r\r\n\r\r\n https://link.userlistmail.', 'Safe', '0000-00-00 00:00:00', '2024-10-18 12:17:40'),
