(752, 4, '19295269e5b6885c', 'You have 9 new invitations', 'LinkedIn <notifications-noreply@linkedin.com>', 'You have 9 new invitations\r\nView invitations:https://www.linkedin.com/comm/mynetwork/?lipi=urn%3Ali%3Apage%3Aemail_email_notification_digest_01%3BG459tcSiT6Gu%2Fj%2FImMjtEA%3D%3D&midToken=AQFx1_eXysh7QQ&midSig=1vjD3ehGF2KHs1&trk=eml-email_notification_digest_01-notification_card_MY_NETWORK-0-null&trkEmail=eml-email_notification_digest_01-notification_card_MY_NETWORK-0-null-null-ly3vur~m2bt2vds~nx-null-null&eid=ly3vur-m2bt2vds-nx&otpToken=MTMwNjFjZTcxMjI5Y2VjY2JkMmYwZmViNDExY2VlYjQ4OGM3ZDE0NjlmYTk4ZjZmN2JjZTAxNmY0YTVlNWFmM2YyZDFkN2U5NTRmOGUwODg2NWEzZGRjMGQ5NDRjMzFlZGMwNjRjODEyMzA1NDRhMGZhZTA0OWUzLDEsMQ%3D%3D\r\n  You have 3 new messages\r\nView messages:https://www.linkedin.com/comm/messaging/?lipi=urn%3Ali%3Apage%3Aemail_email_notification_digest_01%3BG459tcSiT6Gu%2Fj%2FImMjtEA%3D%3D&midToken=AQFx1_eXysh7QQ&midSig=1vjD3ehGF2KHs1&trk=eml-email_notification_digest_01-notification_card_MESSAGING-0-null&trkEmail=eml-email_notification_digest_01-notification_card_MESSAGING-0-null-null-ly3vur~m2bt2vds~nx-null-null&eid=ly3vur-m2bt2vds-nx&otpToken=MTMwNjFjZTcxMjI5Y2VjY2JkMmYwZmViNDExY2VlYjQ4OGM3ZDE0NjlmYTk4ZjZmN2JjZTAxNmY0YTVlNWFmM2YyZDFkN2U5NTRmOGUwODg2NWEzZGRjMGQ5NDRjMzFlZGMwNjRjODEyMzA1NDRhMGZhZTA0OWUzLDEsMQ%3D%3D\r\n  \r\nJessa Reyes shared a post: Senior product manager\r\nWe are seeking an experienced and motivated Senior Product Manager with a strong background in Ruby, JavaScript, and Python. The ideal candidate will have a deep understanding of these technologies and a proven track record of driving product success from conception to launch. You will be responsible for managing the entire product lifecycle, leading cross-functional teams, and delivering innovative solutions that meet customer needs and drive business growth.\r\n\r\nResponsibility\r\n- Product Strategy: Define and communicate the product vision and strategy. Develop and maintain a product roadmap that aligns with the company\'s objectives and market demands.\r\n- Market Research: Conduct market research, customer interviews, and competitive analysis to identify opportunities and guide product development.\r\n- Data-Driven Decision Making: Utilize data analytics to track product performance, measure success, and inform future product decisions.\r\n- Leadership: Mentor and lead junior product managers, fostering a culture of innovation, collaboration, and continuous improvement within the product team.\r\n\r\nQualifications\r\n- Experience: Minimum of 5-7 years of product management experience, with at least 3 years in a senior role, preferably in a software or technology company.\r\n- Education: Bachelor’s degree in Computer Science, Engineering, Business, or a related field; MBA or advanced degree is a plus.\r\n- Technical Skills: Strong understanding of software development processes and methodologies, including Agile. Experience with SaaS, cloud-based solutions, or enterprise software is preferred.\r\n- Leadership: Proven track record of leading cross-functional teams and delivering successful products to market.\r\n- Analytical Skills: Ability to analyze complex data, identify trends, and make data-driven decisions.\r\n- Communication: Excellent communication and interpersonal skills, with the ability to articulate complex ideas clearly to both technical and non-technical stakeholders.\r\n- Customer Focus: Deep understanding of customer needs and the ability to translate them into actionable product requirements.\r\nProblem-Solving: Strong problem-solving skills, with the ability to navigate ambiguity and make strategic decision\r\n\r\n\r\nPerks & Benefits\r\n🏢 Hybrid work model- 3days in the office per week\r\n🍽 Food budget\r\n🚌 Transportation budget\r\n💙 Reimbursable HMO\r\n💸 Yearly bonus\r\n💡 Innovative and impactful projects\r\n🤝 A collaborative and inclusive company culture\r\n💸 Pay raise depending on experience\r\n💸 Salary 120k to 150k\r\n\r\nApply now!\r\n\r\nIf you are an accomplished data scientist eager to make a significant impact through data-driven innovation, we invite you to join our dynamic team at Narra Labs. We are looking for a leader who can bring expertise, enthusiasm, and a collaborative spirit to our projects.\r\n\r\nSend your resume to jess@narralabs.com We look forward to discovering how you can contribute to our mission and help drive our success.\r\nComment:https://www.linkedin.com/comm/feed/update/activity:7251797728999981056?highlightedUpdateUrn=urn%3Ali%3Aactivity%3A7251797728999981056&showCommentBox=true&lipi=urn%3Ali%3Apage%3Aemail_email_notification_digest_01%3BG459tcSiT6Gu%2Fj%2FImMjtEA%3D%3D&midToken=AQFx1_eXysh7QQ&midSig=1vjD3ehGF2KHs1&trk=eml-email_notification_digest_01-notification_digest-0-SHARED_BY_YOUR_NETWORK&trkEmail=eml-email_notification_digest_01-notification_digest-0-SHARED_BY_YOUR_NETWORK-null-ly3vur~m2bt2vds~nx-null-null&eid=ly3vur-m2bt2vds-nx&otpToken=MTMwNjFjZTcxMjI5Y2VjY2JkMmYwZmViNDExY2VlYjQ4OGM3ZDE0NjlmYTk4ZjZmN2JjZTAxNmY0YTVlNWFmM2YyZDFkN2U5NTRmOGUwODg2NWEzZGRjMGQ5NDRjMzFlZGMwNjRjODEyMzA1NDRhMGZhZTA0OWUzLDEsMQ%3D%3D\r\n\r\nCongratulate Jessa Reyes for starting a new position as HR Manager at Narra Labs\r\nSay congratshttps://www.linkedin.com/comm/messaging/compose/jessa-reyes-11529a312/body/i18n_job_change_message_text?propUrn=urn%3Ali%3Aprop%3A%28JOB_CHANGE%2C_019K8PZOj_lgjOVWlHXjNdnTfkes1lYUBOxVhULQ2_InQ%3D%29&lipi=urn%3Ali%3Apage%3Aemail_email_notification_digest_01%3BG459tcSiT6Gu%2Fj%2FImMjtEA%3D%3D&midToken=AQFx1_eXysh7QQ&midSig=1vjD3ehGF2KHs1&trk=eml-email_notification_digest_01-notification_digest-0-JOB_CHANGE_PROP&trkEmail=eml-email_notification_digest_01-notification_digest-0-JOB_CHANGE_PROP-null-ly3vur~m2bt2vds~nx-null-null&eid=ly3vur-m2bt2vds-nx&otpToken=MTMwNjFjZTcxMjI5Y2VjY2JkMmYwZmViNDExY2VlYjQ4OGM3ZDE0NjlmYTk4ZjZmN2JjZTAxNmY0YTVlNWFmM2YyZDFkN2U5NTRmOGUwODg2NWEzZGRjMGQ5NDRjMzFlZGMwNjRjODEyMzA1NDRhMGZhZTA0OWUzLDEsMQ%3D%3D\r\n\r\nFrance Rebol