campaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email6  \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email6  \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email6  \r\n\r\n**Your Free Bonus: The Ultimate AI Skills Pack: \r\nChatGPT + Gemini** \r\n\r\nBuild your proficiency in ChatGPT and Google Gemini for practical, \r\nreal-world applications in cyber. \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email6  \r\n\r\nhttps://coderedmarketing.eccouncil.org/the-cybersecurity-awareness-bundle-2024-super-sale/?utm_source=activecampaign&utm_medium=email&utm_campaign=cybersecurity-awareness-bundle-2024&utm_term=email6  \r\n\r\nhttps://www.facebook.com/ECCouncilLearning \r\n\r\nhttps://twitter.com/ECC_Learning \r\n\r\nhttps://www.linkedin.com/company/ec-council-learning/ \r\n\r\nhttps://www.youtube.com/@ECCouncil-Learning  \r\n\r\n**Copyright © 2024** EC-Council https://www.eccouncil.org | Privacy Statement https://codered.eccouncil.org/privacy-policy\r\n_________________\r\n\r\nSent to: qb202100057@wmsu.edu.ph\r\n\r\nUnsubscribe:\r\nhttp://eccouncil34531.activehosted.com/proc.php?nl=6&c=2072&m=2126&s=bff076bd4894e925f8d87d767a64c24e&act=unsub\r\n\r\nEC-Council International Limited, Sun Ave NE 101C, Albuquerque, New Mexico 87109, United States', 'Safe', '0000-00-00 00:00:00', '2024-10-15 17:09:17'),
