(773, 3, '192ae36fc0124fb6', 'Mokkup.ai is now SOC 2 compliant and ISO 27001 certified', '\"Mokkup.ai\" <community@mokkup.ai>', 'Dear user,\r\n\r\nWe’re excited to share some great news—Mokkup.ai is now officially ISO 27001 certified and SOC2 compliant. This is a big milestone for us, and it’s all about making sure your data is handled with the highest level of security.\r\n\r\nHere’s what this means for you:\r\n\r\n- ISO 27001: We’ve implemented top-notch security standards to manage and protect your data from risks and threats.\r\n- SOC2 Compliance: This detailed report confirms that we meet strict standards for security, availability, and privacy, ensuring we’re always keeping your data safe.\r\nWhy is this important? Because your trust is at the core of everything we do. This not only ensures your data is safe but also solidifies our commitment to delivering secure and dependable services.\r\n\r\nThanks for being part of our journey. We’re committed to providing you with secure and trustworthy solutions.\r\n \r\n[You can view our ISO 27001 certification here.](https://drive.google.com/file/d/13baXzZqo5gNsN_lG1Lvjad9kpZeLuykd/view?usp=sharing)\r\n\r\n \r\nBest Regards,\r\nUjjwal Shukla\r\nProduct Manager\r\n\r\n \r\n\r\nYou received this email from Mokkup.AI. If you would like to unsubscribe, [click here](https://manage.kmail-lists.com/subscriptions/unsubscribe?a=WhaT3q&c=01GYYQDDP39TZ5PP91CQ30J5VC&k=8adab675e6f2049fd6c5b0a482f594b7&m=Rp94Y7&r=5WSfMLi&e=5D6988xz83D).', 'Safe', '0000-00-00 00:00:00', '2024-10-21 10:34:50'),
